import React, { useState } from 'react';
import Header from './components/Header';
import Hero from './components/Hero';
import BrowseSpaces from './pages/BrowseSpaces';
import HowItWorks from './pages/HowItWorks';
import HostSpace from './pages/HostSpace';
import AuthForm from './pages/AuthForm';
import './App.css';

function App() {
    const [currentView, setCurrentView] = useState('home');

    const renderCurrentView = () => {
        switch (currentView) {
            case 'browse':
                return <BrowseSpaces setCurrentView={setCurrentView} />;
            case 'how-it-works':
                return <HowItWorks setCurrentView={setCurrentView} />;
            case 'host':
                return <HostSpace setCurrentView={setCurrentView} />;
            case 'login':
                return <AuthForm type="login" setCurrentView={setCurrentView} />;
            case 'signup':
                return <AuthForm type="signup" setCurrentView={setCurrentView} />;
            default:
                return (
                    <>
                        <Hero setCurrentView={setCurrentView} />
                        <main style={{ padding: '2rem', textAlign: 'center' }}>
                            <h2 style={{ fontSize: '2rem', marginBottom: '1rem', color: '#2d3748' }}>Featured Spaces</h2>
                            <p style={{ fontSize: '1.1rem', color: '#666', marginBottom: '3rem' }}>
                                Discover amazing spaces perfect for your next project
                            </p>

                            {/* Featured Spaces Grid */}
                            <div style={{
                                display: 'grid',
                                gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))',
                                gap: '2rem',
                                marginBottom: '3rem'
                            }}>
                                {[
                                    {
                                        title: "Modern Gallery Space",
                                        description: "Perfect for exhibitions and events",
                                        price: "$150/day",
                                        location: "Auckland CBD",
                                        image: "ðŸŽ¨"
                                    },
                                    {
                                        title: "Workshop Space",
                                        description: "Ideal for classes and workshops",
                                        price: "$80/day",
                                        location: "Ponsonby",
                                        image: "ðŸ”¨"
                                    },
                                    {
                                        title: "Retail Pop-up",
                                        description: "Great for temporary stores",
                                        price: "$200/day",
                                        location: "Newmarket",
                                        image: "ðŸª"
                                    }
                                ].map((space, index) => (
                                    <div key={index} style={{
                                        backgroundColor: 'white',
                                        padding: '1.5rem',
                                        borderRadius: '12px',
                                        textAlign: 'left',
                                        boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
                                        border: '1px solid #e2e8f0'
                                    }}>
                                        <div style={{
                                            fontSize: '3rem',
                                            textAlign: 'center',
                                            marginBottom: '1rem'
                                        }}>
                                            {space.image}
                                        </div>
                                        <h3 style={{ fontSize: '1.25rem', fontWeight: 'bold', marginBottom: '0.5rem', color: '#2d3748' }}>
                                            {space.title}
                                        </h3>
                                        <p style={{ color: '#666', marginBottom: '0.5rem' }}>{space.description}</p>
                                        <p style={{ color: '#667eea', fontWeight: '500', marginBottom: '0.5rem' }}>
                                            {space.price} â€¢ {space.location}
                                        </p>
                                        <button style={{
                                            width: '100%',
                                            backgroundColor: '#667eea',
                                            color: 'white',
                                            border: 'none',
                                            padding: '0.75rem',
                                            borderRadius: '6px',
                                            cursor: 'pointer',
                                            marginTop: '1rem'
                                        }}>
                                            View Details
                                        </button>
                                    </div>
                                ))}
                            </div>

                            {/* Call to Action */}
                            <div style={{ marginTop: '4rem' }}>
                                <button
                                    onClick={() => setCurrentView('browse')}
                                    style={{
                                        backgroundColor: '#667eea',
                                        color: 'white',
                                        padding: '1rem 2rem',
                                        border: 'none',
                                        borderRadius: '8px',
                                        fontSize: '1.1rem',
                                        fontWeight: '600',
                                        cursor: 'pointer',
                                        marginRight: '1rem'
                                    }}
                                >
                                    View All Spaces
                                </button>
                                <button
                                    onClick={() => setCurrentView('host')}
                                    style={{
                                        backgroundColor: 'transparent',
                                        color: '#667eea',
                                        padding: '1rem 2rem',
                                        border: '2px solid #667eea',
                                        borderRadius: '8px',
                                        fontSize: '1.1rem',
                                        fontWeight: '600',
                                        cursor: 'pointer'
                                    }}
                                >
                                    List Your Space
                                </button>
                            </div>
                        </main>
                    </>
                );
        }
    };

    return (
        <div className="App">
            <Header currentView={currentView} setCurrentView={setCurrentView} />
            {renderCurrentView()}
        </div>
    );
}

export default App;
